import React, { useEffect, useState } from "react";
import api from "../../api/axiosConfig";
import { Link } from "react-router-dom";

function MarcaList() {
  const [marcas, setMarcas] = useState([]);
  const [loading, setLoading] = useState(true);

  const cargarMarcas = () => {
    api.get("/marcas/all-marcas")
      .then(response => {
        setMarcas(response.data);
      })
      .catch(error => {
        console.error("Error cargando marcas:", error);
      })
      .finally(() => {
        setLoading(false);
      });
  };

  useEffect(() => {
    cargarMarcas();
  }, []);

  const eliminarMarca = (id) => {
    if (!window.confirm("¿Desea eliminar esta marca?")) return;

    api.delete(`/marcas/eliminar/${id}`)
      .then(() => {
        alert("Marca eliminada exitosamente");
        cargarMarcas();
      })
      .catch(error => {
        console.error("Error eliminando marca:", error);
        alert("No se pudo eliminar");
      });
  };

  if (loading) return <h3>Cargando marcas...</h3>;

  return (
    <div style={{ maxWidth: "900px", margin: "0 auto" }}>
      <h2 style={{ textAlign: "center" }}>Listado de Marcas</h2>

      <div style={{ textAlign: "right", marginBottom: "15px" }}>
        <Link to="/marcas/crear">
          <button
            style={{
              padding: "8px 16px",
              backgroundColor: "#4CAF50",
              color: "white",
              border: "none",
              borderRadius: "6px",
              cursor: "pointer"
            }}
          >
            Crear Nueva Marca
          </button>
        </Link>
      </div>

      {marcas.length === 0 ? (
        <p>No hay marcas registradas.</p>
      ) : (
        <table
          style={{
            width: "100%",
            borderCollapse: "collapse",
            backgroundColor: "#f9f9f9"
          }}
        >
          <thead>
            <tr style={{ backgroundColor: "#4CAF50", color: "white" }}>
              <th style={th}>ID</th>
              <th style={th}>Nombre</th>
              <th style={th}>Bolsos</th>
              <th style={th}>Acciones</th>
            </tr>
          </thead>

          <tbody>
            {marcas.map(marca => (
              <tr key={marca.id} style={tr}>
                <td style={td}>{marca.id}</td>
                <td style={td}>{marca.nombre}</td>
                <td style={td}>
                  {marca.bolsos.length > 0
                    ? marca.bolsos.join(", ")
                    : "Ninguno"}
                </td>

                <td style={td}>
                  <Link to={`/marcas/${marca.id}`}>
                    <button style={btnVer}>Ver</button>
                  </Link>

                  <Link to={`/marcas/editar/${marca.id}`}>
                    <button style={btnEditar}>Editar</button>
                  </Link>

                  <button
                    onClick={() => eliminarMarca(marca.id)}
                    style={btnEliminar}
                  >
                    Eliminar
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

// --- Estilos reutilizables ---
const th = {
  padding: "10px",
  border: "1px solid #ddd",
  textAlign: "center"
};

const td = {
  padding: "10px",
  border: "1px solid #ddd",
  textAlign: "center"
};

const tr = {
  backgroundColor: "white"
};

const btnVer = {
  marginRight: "5px",
  padding: "5px 10px",
  backgroundColor: "#2196F3",
  color: "white",
  border: "none",
  borderRadius: "4px",
  cursor: "pointer"
};

const btnEditar = {
  marginRight: "5px",
  padding: "5px 10px",
  backgroundColor: "#FFC107",
  color: "black",
  border: "none",
  borderRadius: "4px",
  cursor: "pointer"
};

const btnEliminar = {
  padding: "5px 10px",
  backgroundColor: "#F44336",
  color: "white",
  border: "none",
  borderRadius: "4px",
  cursor: "pointer"
};

export default MarcaList;
